import React from 'react';
import { Button } from 'reactstrap';
import './../../src/assets/scss/horizontalAndVerticalBar.scss';

const NavHorizontal = () => {
    const [toggleSelected, setToggleSelected] = React.useState(0);
    return(
        <div className="side-menu-horizontal flex-lg-column">
            <div className="navbar-brand-box">
        </div>  
        <div className="flex-lg-column my-auto">
            <div style={{
                display: 'flex',
                flexDirection: 'row',
                alignItems: 'center',
                justifyContent: 'center',
            }}> 
                <div className={"title"}>Minhas cotações</div>
                <Button color={"link"} style={{textDecoration: 'underline'}} className={"hoverLightGray font-size-8 pumped text-muted ml-3"} onClick={() => setToggleSelected(0)}>Novas</Button>
                <Button color={"link"} className={"hoverLightGray font-size-8 text-muted ml-3"}>Respondidas</Button>
                <Button color={"link"} className={"hoverLightGray font-size-8 text-muted ml-3"}>Não visualizadas</Button>
            </div>
        </div>
    </div>
    )
}

export default NavHorizontal;
